import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a product to open detail modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for product modal and set quantity to 2
    await page.waitForSelector('#quantity', { timeout: 5000 });
    await page.selectOption('#quantity', '2');

    // Add to cart
    await page.click('.modal .add-to-cart.large');

    // Wait for cart update and open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal and update quantity
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.click('.cart-item .quantity-btn:last-child');

    // Wait for quantity update and verify
    await page.waitForFunction(() => {
      const quantity = document.querySelector('.cart-item .quantity');
      return quantity && quantity.textContent === '3';
    }, { timeout: 5000 });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_updated.png'));

    // Extract updated cart data
    const cartData = await page.evaluate(() => {
      const item = document.querySelector('.cart-item');
      if (!item) return null;

      return {
        title: item.querySelector('.cart-item-title')?.textContent,
        price: item.querySelector('.cart-item-price')?.textContent,
        quantity: item.querySelector('.quantity')?.textContent
      };
    });

    return {
      success: true,
      action: "Updated cart item quantity from 2 to 3",
      extractedData: cartData || {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
